import './App.css';
import Login from './Login'; // Import your Login component
import Lottie from "lottie-react";
import testanimation from "./testanimation.json";

const App = () => (
    <div style={{ width: '100%', height: '100vh', display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center' }}> {/* Adjust the style as needed */}
        {/* Lottie Animation */}
        <div style={{ width: '300px', height: '300px' }}> {/* Adjust the size of the container as needed */}
            <Lottie animationData={testanimation} loop={true} />
        </div>

        {/* Login Component */}
        <div style={{ marginTop: '20px' }}> {/* Adjust the margin as needed */}
            <Login />
        </div>
    </div>
);
export default App;
